import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Redirect, useNavigate } from 'react-router-dom';
import Header from './Components/Header';
import AddVehicle from './Components/AddVehicle';
import AllVehicle from './Components/AllVehicle';
import UpdateVehicle from './Components/UpdateVehicle';
import VehicleDetail from './Components/VehicleDetail';
import HomePage from './Components/HomePage';
import LoginHandle from './Components/LoginPage';

import './App.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/side.css';
import './css/vehicle.css';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  const handleLogin = () => {
    // Perform login logic and set isLoggedIn to true upon successful login
    setIsLoggedIn(true);
    // Redirect to HomePage after successful login
    navigate('/update/:id');
  };

  return (
    <Router>
      <div className="App">
        {isLoggedIn ? <Header /> : <Redirect to="/login" />}
        <Routes>
          <Route path="/ho" element={<HomePage />} />
          <Route path="/add" element={<AddVehicle />} />
          <Route path="/all" element={<AllVehicle />} />
          <Route path="/update/:id" element={<UpdateVehicle />} />
          <Route path="/get/:id" element={<VehicleDetail />} />
          {/* Pass onLogin function to handle successful login */}
          <Route path="/login" element={<LoginHandle onLogin={handleLogin} />} />
          <Route path="/Header/:id" element={<Header />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
